import React from "react";

fetch('../data/users.json')
.then()
.then()
.catch(error => {
    console.log(error)
});
function Info(){
    return (
        <div className="row">
            <div className="col">
                <h1 className="bg-primary text-white text-center">Users Information</h1>
            </div>
        </div>
    );
}

export default Info;
